import React from 'react';
import { motion } from 'framer-motion';

const About = () => {
  const features = [
    {
      title: "Profesionales Certificados",
      description: "Nuestro equipo cuenta con especialistas certificados en neuropsicología con amplia experiencia clínica."
    },
    {
      title: "Métodos Basados en Evidencia Científica", 
      description: "Utilizamos técnicas y protocolos respaldados por la investigación científica más actualizada."
    },
    {
      title: "Atención Personalizada",
      description: "Cada tratamiento es diseñado específicamente para las necesidades individuales de cada paciente."
    },
    {
      title: "Seguimiento Presencial y En Línea",
      description: "Ofrecemos flexibilidad en el seguimiento con opciones presenciales y telemedicina."
    }
  ];

  const images = [
    {
      src: "/api/placeholder/280/200",
      alt: "Consulta profesional",
      className: "rounded-3xl shadow-xl",
      size: "large",
      position: "top-left"
    },
    {
      src: "/api/placeholder/200/160", 
      alt: "Terapia grupal",
      className: "rounded-2xl shadow-lg",
      size: "small",
      position: "top-right"
    },
    {
      src: "/api/placeholder/220/180",
      alt: "Evaluación neuropsicológica",
      className: "rounded-2xl shadow-lg",
      size: "medium",
      position: "bottom-left"
    },
    {
      src: "/api/placeholder/260/220",
      alt: "Sesión de rehabilitación",
      className: "rounded-3xl shadow-xl",
      size: "large",
      position: "bottom-right"
    }
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2
      }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0, x: -20 },
    visible: {
      opacity: 1,
      x: 0,
      transition: {
        duration: 0.6
      }
    }
  };

  return (
    <section id="nosotros" className="py-20 bg-white">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <motion.div
          className="text-center mb-16"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
        >
          <h2 className="text-3xl font-bold text-neurops-black sm:text-4xl lg:text-5xl">
            ¿Por qué elegir <span className="text-neurops-black">Neurops</span>?
          </h2>
          <p className="mt-4 max-w-2xl mx-auto text-xl text-gray-600">
            Nos distinguimos por nuestro compromiso con la excelencia y la atención integral
          </p>
        </motion.div>

        <div className="grid lg:grid-cols-2 gap-16 items-center">
          {/* Collage moderno de imágenes cuadradas */}
          <motion.div
            className="w-full max-w-md mx-auto"
            initial={{ opacity: 0, x: -50 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
          >
            <div className="grid grid-cols-2 grid-rows-2 gap-3 aspect-square">
              {/* Top-left: Small square (azul) */}
              <motion.div
                className="row-span-1 col-span-1"
                initial={{ opacity: 0, scale: 0.8 }}
                whileInView={{ opacity: 1, scale: 1 }}
                transition={{ duration: 0.6, delay: 0.1 }}
                viewport={{ once: true }}
                whileHover={{ scale: 1.05, transition: { duration: 0.3 } }}
              >
                <div className="w-full h-full bg-gradient-to-br from-blue-50 to-blue-100 rounded-2xl shadow-md flex items-center justify-center">
                  <div className="text-center text-gray-500">
                    <div className="w-6 h-6 mx-auto mb-1 bg-gray-300 rounded-lg flex items-center justify-center">
                      <svg className="w-3 h-3" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 16l4.586-4.586a2 2 0 012.828 0L16 16m-2-2l1.586-1.586a2 2 0 012.828 0L20 14m-6-6h.01M6 20h12a2 2 0 002-2V6a2 2 0 00-2-2H6a2 2 0 00-2 2v12a2 2 0 002 2z" />
                      </svg>
                    </div>
                    <p className="text-xs">Consulta profesional</p>
                  </div>
                </div>
              </motion.div>

              {/* Top-right: Medium square (rosa) */}
              <motion.div
                className="row-span-1 col-span-1"
                initial={{ opacity: 0, scale: 0.8 }}
                whileInView={{ opacity: 1, scale: 1 }}
                transition={{ duration: 0.6, delay: 0.2 }}
                viewport={{ once: true }}
                whileHover={{ scale: 1.05, transition: { duration: 0.3 } }}
              >
                <div className="w-full h-full bg-gradient-to-br from-pink-50 to-pink-100 rounded-2xl shadow-md flex items-center justify-center">
                  <div className="text-center text-gray-500">
                    <div className="w-8 h-8 mx-auto mb-2 bg-gray-300 rounded-lg flex items-center justify-center">
                      <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 16l4.586-4.586a2 2 0 012.828 0L16 16m-2-2l1.586-1.586a2 2 0 012.828 0L20 14m-6-6h.01M6 20h12a2 2 0 002-2V6a2 2 0 00-2-2H6a2 2 0 00-2 2v12a2 2 0 002 2z" />
                      </svg>
                    </div>
                    <p className="text-xs">Terapia grupal</p>
                  </div>
                </div>
              </motion.div>

              {/* Bottom-left: Large square (verde) */}
              <motion.div
                className="row-span-1 col-span-1"
                initial={{ opacity: 0, scale: 0.8 }}
                whileInView={{ opacity: 1, scale: 1 }}
                transition={{ duration: 0.6, delay: 0.3 }}
                viewport={{ once: true }}
                whileHover={{ scale: 1.05, transition: { duration: 0.3 } }}
              >
                <div className="w-full h-full bg-gradient-to-br from-green-50 to-green-100 rounded-2xl shadow-md flex items-center justify-center">
                  <div className="text-center text-gray-500">
                    <div className="w-10 h-10 mx-auto mb-2 bg-gray-300 rounded-lg flex items-center justify-center">
                      <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 16l4.586-4.586a2 2 0 012.828 0L16 16m-2-2l1.586-1.586a2 2 0 012.828 0L20 14m-6-6h.01M6 20h12a2 2 0 002-2V6a2 2 0 00-2-2H6a2 2 0 00-2 2v12a2 2 0 002 2z" />
                      </svg>
                    </div>
                    <p className="text-xs">Evaluación neuropsicológica</p>
                  </div>
                </div>
              </motion.div>

              {/* Bottom-right: Small square (púrpura) */}
              <motion.div
                className="row-span-1 col-span-1"
                initial={{ opacity: 0, scale: 0.8 }}
                whileInView={{ opacity: 1, scale: 1 }}
                transition={{ duration: 0.6, delay: 0.4 }}
                viewport={{ once: true }}
                whileHover={{ scale: 1.05, transition: { duration: 0.3 } }}
              >
                <div className="w-full h-full bg-gradient-to-br from-purple-50 to-purple-100 rounded-2xl shadow-md flex items-center justify-center">
                  <div className="text-center text-gray-500">
                    <div className="w-6 h-6 mx-auto mb-1 bg-gray-300 rounded-lg flex items-center justify-center">
                      <svg className="w-3 h-3" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                        <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 16l4.586-4.586a2 2 0 012.828 0L16 16m-2-2l1.586-1.586a2 2 0 012.828 0L20 14m-6-6h.01M6 20h12a2 2 0 002-2V6a2 2 0 00-2-2H6a2 2 0 00-2 2v12a2 2 0 002 2z" />
                      </svg>
                    </div>
                    <p className="text-xs">Sesión de rehabilitación</p>
                  </div>
                </div>
              </motion.div>
            </div>
          </motion.div>

          {/* Lista de características sin iconos */}
          <motion.div
            variants={containerVariants}
            initial="hidden"
            whileInView="visible"
            viewport={{ once: true }}
            className="space-y-8"
          >
            {features.map((feature, index) => (
              <motion.div
                key={index}
                variants={itemVariants}
                className="group"
              >
                <div className="border-l-2 border-gray-200 pl-6 py-2 hover:border-neurops-black transition-colors duration-300">
                  <h3 className="text-xl font-bold text-neurops-black mb-3 group-hover:text-gray-600 transition-colors duration-300">
                    {feature.title}
                  </h3>
                  <p className="text-gray-600 leading-relaxed">
                    {feature.description}
                  </p>
                </div>
              </motion.div>
            ))}
          </motion.div>
        </div>
      </div>
    </section>
  );
};

export default About;
